import React from 'react';
import ProductCard from '../../pages/ProductCard';


const Earrings = () => {
  const products = [
    {
      id: 18,
      name: "Beautiful Diamond Stud Earle Earring Rose Gold",
      price: { min: 210, max: 350 },
      rating: 4.5,
      image: "/ragipanis imgs/earrings/earring7.jpg",
      category: "Earrings",
      metal: "Rose Gold",
      stone: "Diamond",
      carat: "18KT",
      isNew: false,
      isSale: false,
      discount: 0,
      description:
        "These beautiful diamond stud earrings are crafted in rose gold with a secure backing. Perfect for everyday wear or special occasions.",
    },
    {
      id: 19,
      name: "Elegant Pearl Drop Earring White Gold",
      price: { min: 180, max: 320 },
      rating: 4.7,
      image: "/ragipanis imgs/earrings/earring8.jpg",
      category: "Earrings",
      metal: "White Gold",
      stone: "Pearl",
      carat: "14KT",
      isNew: true,
      isSale: true,
      discount: 15,
      description:
        "Elegant pearl drop earrings in white gold, perfect for formal events and weddings.",
    },
    // Add more earrings as needed...
  ];

  return (
    <div className="earrings-products">
      <div className="products-grid">
        {products.map(product => (
          <ProductCard key={product.id} product={product} />
        ))}
      </div>
    </div>
  );
};

export default Earrings;
